    if let svg = svGorImage.getSVG() {
        do {
            try svg.setDocumentHeight("100%")
            try svg.setDocumentWidth("100%")
        } catch {
            print("Could not set document size. Output might have wrong size")
        }

        // Create a canvas to draw onto
        UIGraphicsBeginImageContextWithOptions(CGSize(width: width, height: height), false, 0.0)
        guard let context = UIGraphicsGetCurrentContext() else {
            return SimpleResource<UIImage>(UIImage())
        }

        // Render our document onto our canvas
        svg.renderToContext(context)

        let image = UIGraphicsGetImageFromCurrentImageContext()
        UIGraphicsEndImageContext()

        return SimpleResource<UIImage>(image ?? UIImage())
    } else {
        let bitmap = svGorImage.getBitmap()
        return SimpleResource<UIImage>(bitmap)
    }
